import React from 'react'
import styled from 'styled-components';

const ButtonStart = styled.a`
margin-top:3rem;
background:green;
padding:45px 50px;
border-radius:100%;
`;

function StartButton() {
  return (
    <ButtonStart>
        Start
    </ButtonStart>
  )
}

export default StartButton
